type PostDataType = {
    postData: Array<PostData>
}
type PostData = {
    name: string
    message: string
    likes: string
}

export const Profile = (props: PostDataType) => {
    // let postData = [
    //     {name: 'Eduarda', message:'Hello', likes: '15'},
    //     {name: 'Artiom', message:'Good morning', likes: '20'}
    // ]
    return (
        <div>
            <ProfileInfo/>
            <MyPosts postData={props.postData}/>
        </div>
    );
};
